import React, { useCallback, useState, useEffect, useMemo } from "react";
import { useSelector } from "react-redux";
import Onboard from "@web3-onboard/core";
import injectedModule from "@web3-onboard/injected-wallets";
import walletConnectModule from "@web3-onboard/walletconnect";
import coinbaseWalletModule from "@web3-onboard/coinbase";
import Web3 from "web3";
import { isMobile } from "helpers/constants";

const walletConnectOptions = {
  projectId: "4456cf93f371977a7a821eccefb8419d",
  requiredChains: [1, 5, 421613],
  // chainId: 1, // Ethereum mainnet
};
const injected = injectedModule();
const walletConnect = walletConnectModule(walletConnectOptions);
const coinbaseWalletSdk = coinbaseWalletModule({ darkMode: false });

export const WalletContext = React.createContext({
  isActive: false,
  account: "",
  otherWallet: false,
  balance: 0,
  connect: () => {},
  disconnect: () => {},
  chainId: "",
  walletType: "",
  provider: {},
  switchNetwork: () => {},
  chainDetail: {},
});

export const WalletProvider = ({ children }) => {
  const { settings } = useSelector((state) => state.Setting);

  const [onboard, setonboard] = useState();
  const [chainDetail, setchainDetail] = useState({});
  const [walletType, setwalletType] = useState();
  const [isActive, setIsActive] = useState(false);
  const [account, setaccount] = useState("");
  const [otherWallet, setOtherWallet] = useState("");
  const [chainId, setchainId] = useState();
  const [balance, setbalance] = useState(0);
  const [provider, setprovider] = useState("");


  const pathname = window?.location?.pathname &&  window.location.pathname;

  useEffect(() => {
    //  const pathname = window.location.pathname;
     const excluded = ["/welcome","/home"];
    if(excluded.includes(pathname)){
      //if page is welcome and home not show wallet popup
      return;
    }
    console.log("working onboard after logout login");
    initializeOnBoard();
   
  }, [onboard, settings,pathname]);

  const initializeOnBoard = async() =>{
      
    if (!onboard && settings && JSON.stringify(settings) !== "{}") {
      const _onboard = Onboard({
        wallets: [injected, walletConnect, coinbaseWalletSdk],
        appMetadata: {
          name: "Robotic Rabbit",
          icon: !isMobile.any()
            ? "/images/logo2.png"
            : `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="45" height="24" viewBox="0 0 45 24" fill="none">
            <rect width="45" height="23.3251" fill="url(#pattern0)"/>
            <defs>
            <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlink:href="#image0_1_126" transform="scale(0.00049554 0.000956023)"/>
            </pattern>
            <image id="image0_1_126" width="2018" height="1046" xlink:href="data:image/png;base64,"/>
            </defs>
            </svg>`,
          description:
            settings.homePageBannerSetting?.description || "Robotic Rabbit",
        },
        chains: settings.blockchain.map((item) => {
          const network = item.networkUrl.find(
            (nt) => nt.type === settings.blockchainNetworkMode
          );
          return {
            id: Web3.utils.toHex(network.chainId),
            token: network.nativeCurrency?.symbol,
            label: network.nativeCurrency?.name,
            rpcUrl: network.url,
          };
        }),

        notify: {
          enabled: false,
        },

        accountCenter: {
          desktop: {
            enabled: false,
          },

          mobile: {
            enabled: false,
          },
        },
      });

      setonboard(_onboard);

      let _chainDetails = {};
      settings.blockchain.map((item) => {
        const network = item.networkUrl.find(
          (nt) => nt.type === settings.blockchainNetworkMode
        );

        _chainDetails[item.type] = {
          id: network.chainId,
          token: network.nativeCurrency?.symbol,
          label: network.nativeCurrency?.name,
          rpcUrl: network.url,
        };
      });

      setchainDetail(_chainDetails);
      return _onboard;
    }
  }

  useEffect(() => {
    if (onboard) {
      (async () => {
        const previouslyConnectedWallets = JSON.parse(
          localStorage.getItem("connectedWallets")
        );

        if (previouslyConnectedWallets && previouslyConnectedWallets[0]) {
          console.log(
            previouslyConnectedWallets[0],
            "previouslyConnectedWallets"
          );
          connect(previouslyConnectedWallets[0]);
        }
      })();
    }
  }, [onboard]);

  useEffect(() => {
    if (onboard) {
      const walletsSub = onboard.state.select("wallets");
      const { unsubscribe } = walletsSub.subscribe((wallets) => {
        const connectedWallets = wallets.map(({ label }) =>
          label.toLowerCase()
        );
        localStorage.setItem(
          "connectedWallets",
          JSON.stringify(connectedWallets)
        );

        if (wallets[0]) {
          try {
            const { accounts, chains, provider: _provider } = wallets[0];
            setwalletType(wallets[0].label?.toLowerCase());
            setaccount(accounts[0].address);
            setbalance(accounts[0].balance?.ETH || 0);
            setIsActive(true);
            setchainId(Web3.utils.hexToNumberString(chains[0].id));
            setprovider(_provider);
          } catch (err) {
            console.log("err", err);
          }
        }
      });

      return () => {
        unsubscribe && unsubscribe();
      };
    }
  }, [onboard]);

  // Connect to Wallet
  const connect = async (_walletType, chainId) => {
    let _getaccount;
    try {
      console.log("onboard",onboard)
      if (!onboard){
        return;
      }

      let autoSelect = {
        autoSelect: { label: _walletType, disableModals: false },
      };
      _getaccount = await onboard.connectWallet(
        _walletType ? autoSelect : null
      );

      if (chainId) {
        switchNetwork(chainId);
      }
    } catch (error) {
      setwalletType("");
      console.log("Error while wallet connect", error);
    }

    return _getaccount;
  };

  const switchNetwork = useCallback(
    (chainId) =>
      new Promise(async (resolve, reject) => {
        try {
          const result = await onboard.setChain({
            chainId: Web3.utils.numberToHex(Number(chainId)),
          });

          if (result) {
            resolve();
          } else {
            reject("User rejected the request");
          }
        } catch (error) {
          reject(error);
        }
      }),
    [onboard]
  );

  // Disconnect from Metamask wallet
  const disconnect = async (callBack) => {
    try {
      setaccount("");
      setIsActive(false);

      const [primaryWallet] = await onboard.state.get().wallets;
      if (!primaryWallet) return;
      await onboard.disconnectWallet({ label: primaryWallet.label });
      callBack && callBack();
    } catch (error) {
      console.log(error, "<====error");
    }
  };

  const values = useMemo(
    () => ({
      isActive,
      account,
      balance,
      connect,
      disconnect,
      chainId,
      walletType,
      provider,
      switchNetwork,
      chainDetail,
      initializeOnBoard
    }),
    [
      isActive,
      account,
      balance,
      chainId,
      walletType,
      onboard,
      provider,
      switchNetwork,
      chainDetail,
      initializeOnBoard
    ]
  );

  return (
    <WalletContext.Provider value={values}>{children}</WalletContext.Provider>
  );
};
